    data: |
      SELECT DISTINCT col0 AS col2 FROM tab1 WHERE NOT 8 + + 51 NOT BETWEEN - col2 AND - col0 / - 62 + col1 * col0;
  - name: tab1

outputs:
  - name: q5970.out
    data: |
      51
      85
      91
